import React from 'react';
import { Image } from 'react-native';
import Onboarding from 'react-native-onboarding-swiper';
import TwoPartSlide from './TwoPartSlide'; // Import the custom component

const MyOnboarding = () => (
  <Onboarding
    titleStyles={{ color: 'blue' }}
    pages={[
      {
      title: 'Two Part Slide', // Title for the custom slide
      subtitle: 'This is a custom two-part slide',
      backgroundColor: 'green', // Background color for the custom slide
      Component: (
        <TwoPartSlide
          imageSource={require('../LandingPage/burger.png')}
          backgroundColor1="grey"
          backgroundColor2="red"
          title1="Part 1 Title"
          subtitle1="This is the first part of the slide"
          title2="Part 2 Title"
          subtitle2="This is the second part of the slide"
        />
      ),
      },
      {
        backgroundColor: '#fe6e58',
        image: <Image source={require('../LandingPage/burger.png')} />,
        title: 'The Title',
        subtitle: 'This is the subtitle that supplements the title.',
      },
      {
        backgroundColor: '#999',
        image: <Image source={require('../LandingPage/burger.png')} />,
        title: 'Triangle',
        subtitle: "Beautiful, isn't it?",
      },
    ]}
  />
);

export default MyOnboarding;
